function parseWolframLang(s) {
  const tokens = s.split(/(\s+|\$|#+\d*|\\\[[A-Za-z]+\]|"|\\"|\(\*|\*\)|\b)/g)
      .filter((e) => e !== '' && e !== undefined);

  let commentDepth = 0;
  let stringDepth = 0;
  let isPreviousDollar = false;

  const commentStack = [];
  const stringStack = [];
  const numberStack = [];
  const result = [];

  const isLast = (i) => i + 1 === tokens.length;

  const getString = (token) => result.push(`<span class="s">${token}</span>`);
  const getComment = (token) => result.push(`<span class="c">${token}</span>`);
  const getNumber = (token) => result.push(`<span class="m">${token}</span>`);
  const getBuiltIn = (token) => result.push(`<span class="nf">${token}</span>`);
  const getPattern = (token) => result.push(`<span class="np">${token}</span>`);
  const getSlot = (token) => result.push(`<span class="ns">${token}</span>`);
  const getSpecialChar = (token) => result.push(`<span class="ss">${token}</span>`);
  const getSymbol = (token) => result.push(`<span class="nv">${token}</span>`);
  const getPunctuation = (token) => result.push(`<span class="p">${token}</span>`);
  const getOperator = (token) => result.push(`<span class="o">${token}</span>`);

  // Main loop
  for (let i = 0; i < tokens.length; i++) {
    let token = tokens[i];
    if (stringDepth > 0) {
      // Strings
      if (token === '"') {
        stringDepth = 0;
        getString(`"${stringStack.join('')}"`);
        stringStack.length = 0;
      } else {
        stringStack.push(token);
        continue;
      }
    } else {
      // Comments
      if (token === '(*') {
        commentDepth++;
        commentStack.push(token);
        continue;
      }
      if (token === '*)') {
        commentDepth = Math.max(0, commentDepth - 1);
        commentStack.push(token);
        if (commentDepth === 0) {
          getComment(commentStack.join(''));
          commentStack.length = 0;
        }
        continue;
      }
      if (commentDepth > 0) {
        commentStack.push(token);
        continue;
      }
      if (token === '"') {
        stringDepth = 1;
        continue;
      }
      // Numbers
      if (token.match(/^(\d+|\.|\*\^|\*\^\-|`|``)$/) !== null) {
        numberStack.push(token);
        if (isLast(i)) {
          getNumber(numberStack.join(''));
          numberStack.length = 0;
        }
        continue;
      } else {
        if (numberStack.length > 0) {
          getNumber(numberStack.join(''));
          numberStack.length = 0;
        }
      }
      const _match = token.match(/^(\d+)([A-Za-z0-9]+)/);
      if (_match !== null) {
        getNumber(_match[1]);
        token = _match[2];
      }
      // Keywords
      if (isPreviousDollar && !isLast(i)) {
        token = '$' + token;
      }
      if (token === '$') {
        isPreviousDollar = true;
        continue;
      } else {
        isPreviousDollar = false;
      }
      // Built-in
      if (token.match(wolframBuiltInPattern) !== null) {
        getBuiltIn(token);
        continue;
      }
      // Patterns
      if (token.match('_') !== null) {
        getPattern(token);
        continue;
      }
      // Slots
      if (token.match('#') !== null) {
        getSlot(token);
        continue;
      }
      // Special characters
      if (token.match(/^\\\[[A-Za-z]+\]$/) !== null) {
        getSpecialChar(token);
        continue;
      }
      // Symbols
      if (token.match(/^([A-Za-z0-9\$]+)$/) !== null) {
        getSymbol(token);
        continue;
      }
      // Punctuations & operators
      if (token.match(/\s/) === null) {
        token.split(/(<\||\|>|\{|\}|\[|\]|\(|\)|,|;)/g).filter((e) => e !== '').forEach((e) => {
          if (e.match(/(<\||\|>|\{|\}|\[|\]|\(|\)|,|;)/g) !== null) {
            getPunctuation(e);
          } else {
            getOperator(e);
          }
        });
        continue;
      }
      // Spaces
      result.push(token);
    }
  }
  return result.join('');
}
